import Form from "./MyComponent/Form";
import Header from "./MyComponent/Header"
import About from './MyComponent/About'
import React from "react";
import {
  BrowserRouter as Router,
  Switch,
  Route,
} from "react-router-dom";

function App() {
  return ( 
    <div>
        <Header/>
        {/* <Form/> */}
        {/* <About/> */}
        <Router>
          <Switch>
            <Route path="/">
              <Form/>
            </Route>
            <Route path="/about">
              <About/>
            </Route>
          </Switch>
        </Router>
    </div>
  );
}
export default App;
